$.aJz=A.a(["To revolutionize education by providing a dynamic online platform that empowers learners worldwide to unlock their full potential and shape a brighter future."],t.s)
$.b7Z=A.a(["To deliver accessible, innovative, and personalized educational experiences that inspire lifelong learning, foster creativity, and drive meaningful impact in the global community."],t.s)
$.b83=A.a(["\ud83c\udf93 Excellence\nCommitment to delivering high-quality educational content, services, and support to empower learners and enhance their skills and knowledge.","\ud83c\udf93 Inclusivity\nEnsuring accessibility and equal opportunities for all learners, regardless of background, to participate and succeed in educational programs.","\ud83c\udf93 Integrity\nUpholding honesty, transparency, and ethical standards in all aspects of operations, including course offerings, credit transfer processes, and consultancy services.","\ud83c\udf93 Innovation\nEmbracing creativity and staying at the forefront of educational technology to continuously improve learning experiences and outcomes.","\ud83c\udf93 Collaboration\nFostering partnerships with academic institutions, industry experts, and employers to enrich course offerings, provide valuable consultancy services, and facilitate meaningful placements for learners.","\ud83c\udf93 Empowerment\nEmpowering learners to take control of their educational journey, make informed decisions about credit transfer, and access personalized consultancy support to achieve their goals.","\ud83c\udf93 Community\nBuilding a supportive online community where learners can connect, collaborate, and share knowledge and experiences, fostering a sense of belonging and mutual growth."],t.s)
$.b84=A.a(["\ud83c\udf93 Enhanced Learning Experience\nStrive to provide engaging, interactive, and effective online courses that cater to diverse learning styles and preferences.","\ud83c\udf93 Seamless Credit Transfer\nStreamline the credit transfer process to facilitate the smooth transition of learners between educational institutions, ensuring their previous academic achievements are recognized and utilized effectively.","\ud83c\udf93 Comprehensive Consultancy Services\nOffer personalized consultancy support to learners, assisting them in making informed decisions about their educational pathways, career choices, and skill development needs.","\ud83c\udf93 Meaningful Placements\nCollaborate with industry partners to secure valuable placement opportunities for learners, aligning with their academic background, interests, and career aspirations.","\ud83c\udf93 Continuous Improvement\nRegularly evaluate and enhance course offerings, platform features, and support services based on learner feedback, technological advancements, and industry trends to maintain relevance and effectiveness.","\ud83c\udf93 Global Reach and Accessibility\nExpand the platforms reach to learners worldwide, ensuring accessibility for individuals from diverse geographic locations, backgrounds, and socioeconomic statuses.","\ud83c\udf93 Partnership and Collaboration\nForge strategic partnerships with academic institutions, industry stakeholders, and organizations to enrich course content, broaden networking opportunities, and enhance the platforms overall value proposition."],t.s)
$.b85=A.a(["At eG academy, we take pride in our commitment to providing a dynamic and inclusive learning environment for all. With a robust offering of courses available both online and offline, we strive to meet the diverse needs and aspirations of our students.","Whether you prefer the flexibility of remote learning or the immersive experience of on-campus classes, our academy offers a range of options to suit your lifestyle and preferences.","From traditional academic disciplines to cutting-edge fields of study, our comprehensive curriculum is designed to empower students with the knowledge and skills they need to succeed in their chosen paths.","At eG academy, excellence in education knows no bounds, and we are dedicated to fostering a community of lifelong learners who are prepared to thrive in an ever-changing world."],t.s)
$.b86=A.a(["eduGuardian shines as a beacon of opportunity and achievement in the realm of education and career placement where we provide","Customized Educational and Career Placement, Strategic Collaboration for Hybrid Student, Placement Internship Collaborations and Professional Development Workshops."],t.s)
$.b87=A.a(["In our online platform, we provide comprehensive career counseling services to guide users towards their professional aspirations.","Our experienced counselors offer personalized advice, assistance with resume building, interview preparation, and valuable insights into various industries, empowering users to make informed decisions and achieve success in their career."],t.s)
$.b88=A.a(["In our platform, credit transfer facilitates a smooth transition for learners, ensuring their previous academic accomplishments are recognized and utilized effectively.","With seamless credit transfer options, students can maximize their educational journey by leveraging their existing credits towards new courses or programs."],t.s)
$.b89=A.a(["In our platform, flexible learning empowers students to customize their educational journey according to their unique preferences and circumstances.","With a range of flexible course formats and delivery options, learners can seamlessly integrate their studies into their busy lives while maximizing their academic potential."],t.s)
$.b8a=A.a(["In our platform, we offer a wealth of job opportunities tailored to our users skills, interests, and career aspirations.","From internships to full-time positions, our platform connects talented individuals with employers seeking their expertise, facilitating meaningful career advancement and growth."],t.s)
$.b8_=A.a(["In our educational platform, we offer unlimited certification, granting learners the freedom to earn as many certifications as they desire. ","This unique feature empowers individuals to explore diverse topics, expand their skill set, and advance their careers without limitations.","With a wide range of courses available across various disciplines, learners can customize their learning experience according to their interests and goals.","Our rigorous assessment process ensures the credibility and quality of certifications, allowing learners to showcase their expertise and accomplishments with confidence.","With unlimited certification, the possibilities for personal and professional growth are endless."],t.s)
$.b80=A.a(["In our platform, we facilitate seamless credit transfer, allowing students to transfer their academic credits between institutions effortlessly.","Our user-friendly system ensures that learners can efficiently navigate the credit transfer process, maximizing the value of prior educational achievements as they progress towards their academic goals."],t.s)
$.b81=A.a(["Scholarship opportunities provide invaluable support for students pursuing their educational goals. At eG, we are committed to fostering academic excellence and empowering deserving students to reach their full potential. ","Our scholarship programs are designed to recognize outstanding achievement, leadership potential, and financial need among students from diverse backgrounds.","Through generous contributions from donors, alumni, and partners, we offer a range of scholarships to assist students in covering tuition fees, educational expenses, and other costs associated with their studies. ","Whether its merit-based scholarships for academic excellence, need-based scholarships for students facing financial hardships, or special scholarships for underrepresented groups, we strive to ensure that all students have access to quality education and equal opportunities for success.","By investing in scholarships, we aim to inspire and support the next generation of leaders, innovators, and changemakers in their educational journey."],t.s)
$.b82=A.a(["We Embarking on a journey to study abroad is a life-changing experience that offers unparalleled opportunities for personal, academic, and professional growth.","Whether you are drawn to the rich history of Europe, the vibrant culture of Asia, or the dynamic landscapes of the Americas, studying abroad opens doors to new perspectives, languages, and cultures.","This guide serves as your compass, navigating through the myriad of possibilities and providing insights to make your study abroad journey a fulfilling and unforgettable one."],t.s)
